import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { cartStore } from './CartStore';
import { usePopup } from './PopupProvider';
import './Stores.css';  // ייבוא קובץ ה-CSS

const PizzaHutMenu = () => {
  const navigate = useNavigate();
  const { setImages, setVisible } = usePopup();

  const menu = [
    { name: 'Margherita', price: 30, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Pepperoni', price: 35, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Vegetarian', price: 32, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'BBQ Chicken', price: 38, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Hawaiian', price: 33, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Four Cheese', price: 40, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Meat Lovers', price: 42, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Spicy Italian', price: 36, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Pesto Veggie', price: 34, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Mushroom Truffle', price: 41, images: [
      "data:image/jpeg;base64,"
    ]},
  ];

  const goToCart = () => {
    navigate('/cart');
  };

  const handleImage = (images) => {
    setVisible(true);
    setImages(images);
  };

  return (
    <div className="menu-container PizzaHut-menu-container">
      <h2>Pizza Hut Menu</h2>
      <ul>
        {menu.map((item, index) => (
          <li key={index}>
            {item.name} - {item.price} ₪
            <div className="resButtons">
              {item.images.length > 0 && <button onClick={() => handleImage(item.images)}>צפה במוצר</button>}
              <button onClick={() => cartStore.addItem(item)}>+</button>
            </div>
          </li>
        ))}
      </ul>
      <button className="go-to-cart-button" onClick={goToCart}>Go to Cart</button>
    </div>
  );
};

export default PizzaHutMenu;
